  font-size: 30px;
  line-height: 1.2;
  letter-spacing: -0.01em;

  margin: 0;
  margin-bottom: 25px;
}

.servicesSection__listOfServices_card_text {
  font-size: 17px;
  line-height: 1.2;
  width: 450px;
  margin-bottom: 30px;
}

.servicesSection__listOfServices_card_content {
  display: flex;
  flex-direction: column;
  align-items: start;
  width: 530px;
}

.servicesSection__listOfServices_card_buttonWrapper {
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 530px;
}

.servicesSection__listOfServices_card_buttonWrapper_button_popup  {
  font-size: 20px;
  transition: all 0.3s;
}

.servicesSection__listOfServices_card_buttonWrapper_button_popup:hover {
  color: #fff;
  border: 1px solid #fff;
  background: #00719b;
}

.registerButton {
  border: 1px solid #00719b;
  border-radius: 45px;
  width: 317px;
  height: 60px;
  color: #00719b;
  cursor: pointer;
}

.servicesSection__listOfServices_register_titleBlock {
  color: #fff;
  width: 1120px;
}

.servicesSection__listOfServices_register_titleBlock_text {
  font-size: 46px;
  line-height: 1;
  margin-top: 0;
}

.servicesSection__listOfServices_register_titleBlock_question {
  font-size: 24px;
  line-height: 1.2;
  color: rgba(255, 255, 255, 0.6);
}

.servicesSection__button {
  border: 1px solid #06739a;
  border-radius: 51px;
  height: 60px;
  width: 100%;
  color: #00719b;
  font-size: 20px;
  cursor: pointer;
  transition: all 0.3s;
}

.servicesSection__button:hover {
  color: #fff;
  border: 1px solid #fff;
  background: #00719b;
}

@media screen and (max-width: 1160px) {
  .feedback__body_card--second {
    display: none;
  }
}

